import { useState } from 'react';
import './App.css';
import PriceTable from './components/PriceTable';
import Sales from './components/Sales';
import Paper from "@material-ui/core/Paper";
import Tab from "@material-ui/core/Tab";
import Tabs from "@material-ui/core/Tabs";


function App() {
  const [currentSection, setCurrentSection] = useState('NFT');
  const [toggle,setToggle] = useState(false);
  const handleClick = (e) => {

    const [value, setValue] = useState(2);
    // if (e.target.id !== currentSection) {
    //   setToggle(preState=> !preState);
    //   setCurrentSection(e.target.id)
    //   console.log(currentSection);

    // }
  }
  return (
    <div className="App">
      <div className="section">
        <Paper square>
          <Tabs
            value={value}
            textColor="primary"
            indicatorColor="primary"
            onChange={(event, newValue) => {
              setValue(newValue);
            }}
          >
            <Tab label="Active TAB One" />
            <Tab label="Active TAB Two" />
            <Tab label="Disabled TAB!" disabled />
            <Tab label="Active Tab Three" />
          </Tabs>
          <h3>TAB NO: {value} clicked!</h3>
        </Paper>
      </div>
      {/* {currentSection === "NFT" ? <PriceTable hidden={true} /> : <Sales />} */}
      <PriceTable hidden={toggle} /> 
      <Sales hidden={!toggle}/>
    </div>

  );
}

export default App;
